import React from 'react';
import {Box} from "@chakra-ui/react";

const QuestionDialog = () => {
    return (
        <Box
            zIndex={9000}
            position={'fixed'}
            top={10} right={50}
            minH={'800px'}
            bg={'red'}
            minW={'600px'}>
            sdsd
        </Box>
    );
};

export default QuestionDialog;
